import ExpenseItem from "./components/ExpenseItem";
function App() {
  const expense = [
    { title: "Car Insurance", amount: 294.67, date: new Date(2022, 6, 14) },
    { title: "Rent", amount: 214.67, date: new Date(2022, 5, 28) },
    { title: "class Fees", amount: 45, date: new Date(2022, 6, 12) },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem title={expense[0].title} amount={expense[0].amount} date={expense[0].date}></ExpenseItem>
      <ExpenseItem title={expense[1].title} amount={expense[1].amount} date={expense[1].date}></ExpenseItem>
      <ExpenseItem expenseDate="2022-06-11" expenseTitle="rent" expenseAmount="900"></ExpenseItem>
    </div>
  );
}

export default App;
